import React from "react";

const Login = () => {
  const skip = () => {
    window.location = "index.html";
  };

  const myfun = () => {
    const username = document.getElementById("username").value;
    const password = document.getElementById("password").value;
    if (username === "admin" && password === "admin") {
      window.location = "index.html";
    } else {
      const paraElement = document.getElementById("para");
      if (paraElement) {
        paraElement.innerHTML = "Invalid Credentials";
      }
    }
  };

  return (
    <div>
        <div class="nav">
        <div class="logo">
            <img src="https://cdn.pixabay.com/photo/2013/07/12/15/53/shopping-cart-150504_1280.png" alt="no image" width="100px" style={{padding: "10px;"}} />
        </div>
        <div class="memu">
            <a href="/home">Home</a>
            <a href="./products.html">Products</a>
            <a href="./contact.html">Contact us</a>
        </div>
        <div class="btns">
            <button><a href="./login.html">login</a></button>
        </div>
    </div>
    <div class="login">
        <div class="loginbox">
            <p onclick="skip()">Skip</p>
            <h2>LOGIN</h2><br/>
            <label for="username"> USER NAME</label>
            <input type="text" id="username"/><br/><br/>
            <label for="password">PASSWORD</label>
            <input type="password" name="password" id="password"/><br/><br/>
            <center><button onclick="myfun()">login</button></center>
        </div>
    </div>
    </div>
  );
};

export default Login;
